  selector: 'app-form-skill',
  templateUrl: './form-skill.component.html'
})
export class FormSkillComponent {

}




export class FormEducationComponent implements OnInit{
  Form:FormGroup;

  constructor(
  private formBuilder:FormBuilder,
  private dataService:DataService,
  private ruta:Router){
    this.Form=this.formBuilder.group(
      {
        //aca.....
        form_title:["",[Validators.required]],
        form_description:["",[Validators.required]],
        form_period:["",[Validators.required],[Validators.minLength]],
        form_imgurl:["",[Validators.required]],
        deviceInfo:this.formBuilder.group({
          deviceId:[""],
          deviceType:["DEVICE_TYPE_ANDROID"],
          notificationToken:[""]
        })
      }
    )
  }
  ngOnInit(): void {}

  get Title(){
    return this.Form.get("form_title");
  }
  get Description(){
    return this.Form.get("form_description");
  }
  get Period(){
    return this.Form.get("form_period");
  }
  get ImgUrl(){
    return this.Form.get("form_imgurl");
  }
  get FormValid(){
    return (!this.Form.get("form_title")?.errors && !this.Form.get("form_description")?.errors && !this.Form.get("form_period")?.errors && !this.Form.get("form_imgurl")?.errors);
  }

  onSend(event:Event){
    event.preventDefault();

    const body = {
        //id:0,
        title:this.Form.get('form_title')?.value,
        description:this.Form.get('form_description')?.value,
        period:this.Form.get('form_period')?.value,
        img_icon:this.Form.get('form_imgurl')?.value
      }
    this.dataService.addEducation(body).subscribe((data:any)=>{
      console.log("DATA:" + JSON.stringify(data));
    })
  }
}
